People in the District of Columbia will soon be required to show proof of vaccination before entering many indoor establishments as COVID-19 cases in the city skyrocket. The recent surge comes as the Omicron variant spreads across U.S. and around the world, prompting new safety precautions and worldwide concern.&nbsp;
“I don’t make any of these types of decisions lightly,” Mayor Muriel Bowser said Wednesday at a briefing.
Beginning January 15, those aged 12 and older will be required to show proof of at least one dose of an approved vaccine to enter establishments including restaurants, nightclubs, coffee shops, concert venues, movie theaters and gyms.

